insert into WISGCICATU_PRD.TEMP_FUNDOS  values ('PCC49','03537456000183','ICATU SEG CLASSIC DIVIDENDOS 49 FIC FIM','Fundo de previdÍncia balanceado gerido pela Icatu Vanguarda. O fundo balanceado È um tipo particular de multimercado que investe somente em renda vari·vel e renda fixa em uma proporÁ„o definida. O fundo se caracteriza por ter a sua parcela de renda vari·vel buscando superar consistentemente e com menos risco o Ibovespa investindo em aÁıes de empresas que tenham boa gest„o e governanÁa, business est·vel e com previsibilidade de resultados, proteÁ„o contra inflaÁ„o, valuation atrativo com perspectiva de crescimento e que distribuam dividendos, juros sobre capital prÛprio e outros proventos. Outra caracterÌstica desses fundos È que a sua parcela de renda fixa adota a estratÈgia de investimento de inflaÁ„o curta, que compra tÌtulos p˙blicos e privados indexados ‡ inflaÁ„o com vencimentos inferiores a 5 anos. Pode aplicar atÈ 49% em renda vari·vel.','ICATU VANGUARDA GEST√O DE RECURSOS LTDA','1,50','1,50','N„o h·','-','PGBL','PGBL ICATU CLASSIC DIVIDENDOS 49 - INDIVIDUAL','15414900865201659','N','Renda Mensal Tempor·ria 15 Anos','60','60',NULL,'60','60','Anualmente pelo IPCA','Anualmente pelo IPCA',NULL,NULL,'00410','5000,00','300,00','Vanguarda.jpg');
