insert into WISGCICATU_PRD.TEMP_FUNDOS  values ('RREAL','12823627000121','ICATU SEG FIC FI RF INFLA«√O CURTA','… um fundo que investe em tÌtulos p˙blicos e privados indexados ‡ inflaÁ„o com vencimentos inferiores a 5 anos. A carteira do fundo busca replicar a composiÁ„o do IMA-B 5 tendo duration e yield prÛximos ao Ìndice. Apresenta volatilidade moderada apesar de ser de renda fixa. Essa caracterÌstica deve-se a necessidade de marcar a mercado os tÌtulos que compıem a carteira do fundo, isto È, os papÈis devem ter o seu valor de venda atualizados diariamente mesmo que sejam carregados atÈ o vencimento. As NTN-Bs por possuÌrem um car·ter prÈ-fixado apresentam variaÁ„o no seu preÁo unit·rio conforme alteraÁıes nas expectativas de juros futuras, de maneira geral se h· expectativa de subida nas taxas de juros os preÁos dos tÌtulos caem e se h· expectativa de queda nas taxas de juros os preÁos sobem.','ICATU VANGUARDA GEST√O DE RECURSOS LTDA','1,00','1,00','N„o h·','-','PGBL','PGBL ICATU CLASSIC RETORNO REAL - INDIVIDUAL','15414900849201666','N','Renda Mensal Tempor·ria 15 Anos','60','60',NULL,'60','60','Anualmente pelo IPCA','Anualmente pelo IPCA',NULL,NULL,'00410','5000,00','300,00','Vanguarda.jpg');
