insert into WISGCICATU_PRD.TEMP_FUNDOS  values ('VIN2','23964741000198','VINCI EQUILÕBRIO ICATU PREV FIC FIM II','Fundo multimercado gerido pela Vinci. O fundo aloca recursos nas seguintes estratÈgias: renda fixa ñ pÛs-fixado, renda fixa ñ inflaÁ„o curta e renda vari·vel ñ dividendos. A gestora possui bom histÛrico na estratÈgia de dividendos cujo objetivo È realizar investimentos em empresas de bons retornos de longo prazo e com baixa volatilidade. Tais empresas, em geral, s„o maduras, com baixo risco de negÛcio, baixo risco de projeÁ„o, geram lucros e tÍm baixa necessidade de re-investimento. AlÈm disso, possuem sustent·vel geraÁ„o de caixa e de distribuiÁ„o de resultados e tambÈm possuem boa proteÁ„o contra inflaÁ„o.','VINCI GEST√O DE PATRIM‘NIO LTDA','2,00','2,00','N„o h·','-','PGBL','PGBL ICATU VINCI EQUILÕBRIO - INDIVIDUAL','15414900877201683','N','Renda Mensal Tempor·ria 15 Anos','60','60',NULL,'60','60','Anualmente pelo IPCA','Anualmente pelo IPCA',NULL,NULL,'00410','5000,00','300,00','Vinci.png');
