insert into WISGCICATU_PRD.TEMP_FUNDOS  values ('C1791','26343792000190','CSHG GAUSS ICATU PREV FIC FIM','O fundo CSHG Gauss Icatu Prev FIC FIM conta com a gest„o da CSHG Asset Management. A gest„o È baseada na mesma filosofia e estratÈgia de investimento adotada no segmento multimercado da gestora, do qual o CSHG Gauss Master FIM ñ lanÁado em dez de 2014 ñ integra. O CSHG Gauss Icatu Prev FIC FIM tem por objetivo buscar retorno atravÈs de investimentos em diversas classes de ativos financeiros disponÌveis nos mercados de renda fixa, renda vari·vel, cambial, derivativos e cotas de fundos de investimento, negociados nos mercados interno e externo, sem o compromisso de concentraÁ„o em nenhuma classe especÌfica.','GAUSS CAPITAL GESTORA DE RECURSOS LTDA','2,00','2,00','N„o h·','-','PGBL','PGBL CSHG Gauss Icatu Prev FIC FIM','15414900928201758','N','Renda Mensal Tempor·ria 15 Anos','60','60',NULL,'60','60','Anualmente pelo IPCA','Anualmente pelo IPCA',NULL,NULL,'00410','5000,00','300,00','CSHG.png');
