insert into WISGCICATU_PRD.TEMP_FUNDOS  values ('ATENA','26680218000128','ATHENA ICATU PREV FIM 49','Fundo de previdÍncia multimercado gerido pela Athena Capital. O fundo investe basicamente em tÌtulos p˙blicos de baixo risco e renda vari·vel. A parcela de renda vari·vel adota como filosofia de investimento uma an·lise fundamentalista, amparada majoritariamente por an·lises e observaÁıes feitas diretamente na economia real. O fundo possui por objetivo proporcionar ganhos absolutos e consistentes a mÈdio e longo prazo, sem perseguir correlaÁ„o com qualquer Ìndice de Bolsa. A parcela de renda vari·vel do fundo fica predominantemente comprada em aÁıes, mas pode, eventualmente, ter posiÁıes vendidas para ganho absoluto. Pode alocar atÈ 49% de seu PL em renda vari·vel.','ATHENA CAPITAL GEST√O DE RECURSOS LTDA','1,10','2,00','N„o h·','-','PGBL','PGBL INDIVIDUAL ICATU ATHENA MULTIMERCADO','15414901334201683','N','Renda Mensal Tempor·ria 15 Anos','60','60',NULL,'60','60','Anualmente pelo IPCA','Anualmente pelo IPCA',NULL,NULL,'00410','5000,00','300,00','Athena.png');
