insert into WISGCICATU_PRD.TEMP_FUNDOS  values ('JR024','28320997000186','ICATU SEG TESOURO JURO REAL 2024 FICFIRF','O Tesouro IPCA+ (NTN-B 2024) È um tÌtulo pÛs-fixado, cuja rentabilidade È composta por uma taxa anual (Yield) pactuada no momento da compra mais a variaÁ„o do IPCA (Õndice de PreÁos ao Consumidor Amplo), Ìndice de inflaÁ„o oficial do governo brasileiro. O fundo visa replicar a rentabilidade da NTN-B 2024 (menos os custos do fundo), proporcionando rentabilidade real, ou seja, preservando o aumento de poder de compra do seu dinheiro. Esse investimento se destina a investidores com investimentos com vencimentos em torno de 2024 e que tolerem oscilaÁ„o de cotas em janelas mais curtas.','ICATU VANGUARDA GEST√O DE RECURSOS LTDA','0,75','0,75','N„o h·','-','PGBL','PGBL ICATU SEG TESOURO JURO REAL 2024 FICFI RF','15414901050201778','N','Renda Mensal Tempor·ria 15 Anos','60','60',NULL,'60','60','Anualmente pelo IPCA','Anualmente pelo IPCA',NULL,NULL,'00410','10000,00','800,00','Vanguarda.jpg');
