insert into WISGCICATU_PRD.TEMP_FUNDOS  values ('MACRO','28557920000124','ICATU SEG MACRO FIM PREV','O fundo Icatu Seg Macro Prev È um fundo multimercado que ter· gest„o compartilhada entre as equipes de multiestratÈgia e de renda vari·vel da Icatu Vanguarda. As decisıes de investimento do fundo s„o tomadas em conjunto pelos gestores/traders respons·veis por cada uma das ·reas a partir de an·lise macro fundamentada em modelos prÛprios. O objetivo do fundo È oferecer retornos consistentes no longo prazo e a preservaÁ„o do capital contando com um portfÛlio diversificado e com elevada liquidez. O fundo far· operaÁıes em diversos mercados incluindo os mercados de renda fixa, renda vari·vel e c‚mbio. OperaÁıes Shorts e DayTrade s„o permitidas.','ICATU VANGUARDA GEST√O DE RECURSOS LTDA','0,95','1,80','N„o h·','-','PGBL','PGBL ICATU SEG MACRO','15414900686201883','N','Renda Mensal Tempor·ria 15 Anos','60','60',NULL,'60','60','Anualmente pelo IPCA','Anualmente pelo IPCA',NULL,NULL,'00410','5000,00','300,00','Vanguarda.jpg');
