insert into WISGCICATU_PRD.TEMP_FUNDOS  values ('GLOBA','28557951000185','ICATU SEG GLOBAL EQUITY INCOME 10 FI MUL','O fundo nasceu da parceria entre a Icatu Seguros e BlackRock. O fundo investe em uma carteira diversificada composta por tÌtulos atrelados ‡ inflaÁ„o com vencimento inferior a 5 anos e de aÁıes globais de alta qualidade (atÈ 10% do PL). A gest„o do fundo fica a cargo da Icatu Vanguarda que faz a alocaÁ„o da parte de renda fixa brasileira e investe, via veÌculos locais, em uma estratÈgia de aÁıes globais da BlackRock. A diversificaÁ„o È o grande diferencial do produto, a estratÈgia gerida pela BlackRock oferece uma diversificaÁ„o geogr·fica e setorial muito mais ampla que o investimento em renda vari·vel local. AlÈm disso, a alocaÁ„o em ativos atrelados a Ìndice de preÁos proporciona ganho real e proteÁ„o contra a inflaÁ„o. Fatores que tornam o fundo atrativo para investimento de longo prazo.','ICATU VANGUARDA GEST√O DE RECURSOS LTDA','1,00','1,10','N„o h·','-','PGBL','PGBL INDIVIDUAL ICATU GLOBAL EQUITY INCOME 10 FIM','15414901326201718','N','Renda Mensal Tempor·ria 15 Anos','60','60',NULL,'60','60','Anualmente pelo IPCA','Anualmente pelo IPCA',NULL,NULL,'00410','5000,00','300,00','Vanguarda.jpg');
