insert into WISGCICATU_PRD.TEMP_FUNDOS  values ('PACIF','28626203000107','PACIFICO ICATU PREV FIM','O Pacifico Icatu PrevidÍncia È um fundo multimercado gerido pela Pacifico Gest„o de Recursos que busca retorno absoluto atravÈs de estratÈgia direcionais nos mercados de renda fixa e renda vari·vel, utilizando instrumentos de c‚mbio, juros e aÁıes. EstratÈgia com estilo macro, onde todas as posiÁıes tÍm em comum o cen·rio macroeconÙmico traÁado pela equipe de gest„o. Em renda vari·vel soma-se o estudo profundo de setores e empresas, com o objetivo de identificar empresa com grande potencial de valorizaÁ„o.','PACIFICO GEST√O DE RECURSOS LTDA','0,90','1,00','20% (vinte por cento) do que exceder a 100% (cem por cento) da variaÁ„o do CDI','-','PGBL','PGBL INDIVIDUAL PACIFICO ICATU FIM','15414900014201878','N','Renda Mensal Tempor·ria 15 Anos','60','60',NULL,'60','60','Anualmente pelo IPCA','Anualmente pelo IPCA',NULL,NULL,'00410','5000,00','300,00','Pacifico.png');
