insert into WISGCICATU_PRD.TEMP_FUNDOS  values ('SPXLA','28653832000126','SPX LANCER ICATU PREV FIC FIM','Fundo de previdÍncia multimercado gerido pela SPX Capital, uma das maiores gestoras de recursos independentes do Brasil. O fundo possui um gestor exclusivo dedicado a atividade gest„o e atua no mercado de juros e inflaÁ„o global, moedas, aÁıes e Ìndices de bolsa globais e commodities, considerando as restriÁıes legais de previdÍncia. O objetivo do fundo È a preservaÁ„o de capital e geraÁ„o de retorno absoluto no longo prazo. Como diferencial, destaque para a combinaÁ„o de estratÈgias domÈsticas e globais.','SPX GEST√O DE RECURSOS LTDA','0,90','1,00','N„o h·','-','PGBL','PGBL INDIVIDUAL SPX LANCER ICATU FICFI MULTIMERCADO','15414900166201871','N','Renda Mensal Tempor·ria 15 Anos','60','60',NULL,'60','60','Anualmente pelo IPCA','Anualmente pelo IPCA',NULL,NULL,'00410','100000,00',NULL,'spx-capital.png');
