insert into WISGCICATU_PRD.TEMP_FUNDOS  values ('ATH70','29045319000115','ATHENA ICATU PREVIDENCI¡RIO FIM 70','Fundo de previdÍncia multimercado gerido pela Athena Capital. O fundo investe basicamente em tÌtulos p˙blicos de baixo risco e renda vari·vel. A parcela de renda vari·vel adota como filosofia de investimento uma an·lise fundamentalista, amparada majoritariamente por an·lises e observaÁıes feitas diretamente na economia real. O fundo possui por objetivo proporcionar ganhos absolutos e consistentes a mÈdio e longo prazo, sem perseguir correlaÁ„o com qualquer Ìndice de Bolsa. A parcela de renda vari·vel do fundo fica predominantemente comprada em aÁıes, mas pode, eventualmente, ter posiÁıes vendidas para ganho absoluto. Pode alocar atÈ 70% de seu PL em renda vari·vel.','ATHENA CAPITAL GEST√O DE RECURSOS LTDA','1,97','2,05','20% (vinte por cento) do que exceder a 100% (cem por cento) da variaÁ„o do IPCA + IMA-B','-','PGBL','PGBL INDIVIDUAL ICATU ATHENA 70','15414900282201890','N','Renda Mensal Tempor·ria 15 Anos','60','60',NULL,'60','60','Anualmente pelo IPCA','Anualmente pelo IPCA',NULL,NULL,'00410','5000,00','300,00','Athena.png');
